import React from 'react';
import '../SolutionPage.css';

function VirtualReceptionists() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">The Future of Virtual Receptionists</h1>
      <div className="solution-desc">A look at how virtual receptionists are evolving with new technology.</div>
      <div className="solution-section">
        <p>Virtual receptionists are becoming more advanced, using AI and automation to handle complex tasks, schedule appointments, and provide personalized service. The future promises even more integration with business tools and smarter customer interactions.</p>
      </div>
    </div>
  );
}

export default VirtualReceptionists;
